html, body {
	overflow   : none;
	height     : 100%;
	width      : 100%;
	margin     : 0;
	padding    : 0;

	background : #FFF;
        /*
        font       : 16px/21px "Myriad Regular", Helvetica, Helvetica Neue, Arial;
        */
	font       : 16px/21px "Myriad Regular", "myriad-pro", Helvetica, Helvetica Neue, Arial;
	color      : #666;
}

/*** General style & theming ***/
.rass-container {
/*
        height: 1%;
*/
	display            : block;
	box-sizing         : border-box;

	width              : 100%;
	min-width          : 310px;
	max-width          : 480px;
	margin             : auto;
	padding            : 12px;

	-webkit-box-sizing : border-box;
}

.rass-container strong {
        /*
        font-family: "Myriad Semibold";
        */
}

.rass-container p, h3 {
	margin-left : 4px;
}

.rass-page-title {
	position      : relative;
	display: inline-block;
	width: 100%;
	-webkit-box-sizing: border-box;
	-moz-box-sizing: border-box;
	box-sizing: border-box;
	margin        : 0 0 1em 4px;
	padding-top   : 0.75em;
	padding-right : 1.7em;

    /*
        *** remote font currently doesn't work on safari ios8 ***
        font-family: "Myriad Light", Helvetica, Helvetica Neue, Arial;
    */
	font-family   : "myriad light", "myriad-pro-light", Helvetica, Helvetica Neue, Arial;
	font-size     : 1.7rem;
	font-weight   : normal;
	color         : #000099;
	line-height   : 1.9rem;
	
}

.rass-page-title .rass-ui-logo {
	position : absolute;
	top      : 3px;
	right    : 4px;

	width    : 49px;
}

.rass-layout-center .rass-page-title {
	padding-right: 0;
}

.rass-layout-center .rass-page-title p {
	color: #333;
	margin:0;
	padding-top: 4px;
	padding-bottom: 4px;
	text-align: center;
	font-size: 1rem;
	font-family: "Myriad Regular", Helvetica, Helvetica Neue, Arial;
}

.rass-layout-center .rass-page-title span {
	width: 100%;
	display: block;
	text-align: center;
	padding-bottom: 40px;
	padding-top: 0.5em;
}

.rass-page-title p {
	padding-top: 4px;
	padding-bottom: 4px;
}

.rass-page-title .rass-profile-avatar {
	height: 90px;
}

.rass-section-action {
        /*
        margin-top: 2em;
        */
}

.rass-section-input ul, .rass-section-input ul li {
	margin-left : 10px;
	padding     : 0;
}

.rass-section-input ul li {
	margin-left : 11px;
	text-indent : -5px;
}

.rass-section-input label {
	display   : block;
	clear     : both;
	color:#999;
	font-size : 0.9rem;
}

.rass-section-input input {
	color: #009;
}

.rass-section-input .rass-wrapper-prefix label {
	margin-left : 16px;
}

.rass-section-input label input {
	display       : block;
	border-radius : 0;
        /*
        width: 98%;
    	*/
}

.rass-section-input .rass-uicontrol-qrcode {
	display: block;
	max-width: 250px;
	max-height: 250px;
	margin-left      : -22px;
	padding          : 0 0 0 6px;
	margin-top: 0;
	background-color : #FFF;
}

.rass-section-input strong {
	color: #333;
}

.footer	{
	margin-bottom: 1em;
}

.footer ul {
	margin       : 0;
	padding-left : 0;

	list-style   : none;
}

.rass-container a {
	padding-left : 1em;

	font-size    : 1rem;
	color        : #009;
}

/*** extended ui ***/
.rass-ui-headless h1 {
	display : none;
}

/* iban prefix */
.rass-section-input .rass-extend-prefix {
	display       : inline-block;
	float         : left;

	width         : 100px;
	margin-top    : 0;
	padding-right : 0;
	padding-left  : 0;

/*
	background    : #EEE;
*/
	color         : #333;
/*
        width: 104px;
        padding-left: 2px;
        padding-right: 2px;
*/
	text-align    : right;
/*
        border-top-right-radius: 0;
        border-bottom-right-radius: 0;
*/
	border-radius : 0;
	border-right  : none;
	border-right  : none;

	line-height: 20px;
	height: 20px;

}

#rass-data-reknr {
 /*
        width:98%;
        float:right;
 */

 	height: 20px;
 	line-height: 20px;

 	float         : left;

	margin-top    : 0;
	margin-right  : -117px;
	padding-left  : 0;

/* 
        border-top-left-radius: 0;
        border-bottom-left-radius: 0;
*/
	border-radius : 0;


}

.rass-wrapper-prefix {
	padding-right : 117px;
}

.rass-wrapper-prefix span {
	display : block;
}

.rass-section-input .rass-wrapper-prefix::after {
	content : "";

	display : block;
	clear   : both;
}

