.rass-section-action .rass-action-plus{background-image:;background-size:30px;height:2rem;background-repeat:no-repeat;padding-left:2.4rem;margin-left:4px;}
.rass-section-action .rass-action-plus:hover{background-image:;background-size:30px;background-repeat:no-repeat;padding-left:2.4rem}
.rass-section-input ul li{text-indent:0;}


.rass-container a.rass-reader-link{background-image:;background-size:30px;/*line-height:190%;*/background-repeat:no-repeat;padding-left:2.4rem}
.rass-container a.rass-reader-link:hover{background-image:;background-size:30px;background-repeat:no-repeat;padding-left:2.4rem}
.rass-container a.rass-arrow-link{background-image:url('/img/rabo/arrow.svg');background-size:30px;line-height:128%;background-repeat:no-repeat;padding-left:2.4rem}
.rass-section-confirmation {margin-top:2em;padding-top:2em;border-top: 1px solid #CCC}
.rass-section-service ul li a:before,.rass-section-service ul li a:after{display:none}
.rass-section-service ul li a{background-image:/*savepage-url=icon_supercirkel_pijl_wit60.svg*/url();background-repeat:no-repeat;background-size:30px;padding-left:40px;line-height:112%}
.rass-section-service ul li a:hover{background-image:/*savepage-url=icon_supercirkel_pijl_wit60_mo.svg*/url()}
.rass-section-service ul li.rass-more a{background-image:/*savepage-url=icon_supercirkel_pijl_wit.svg*/url();background-repeat:no-repeat;background-size:30px;padding-left:40px}
.rass-section-service ul li.rass-more a:hover{background-image:/*savepage-url=icon_supercirkel_pijl_wit_mo.svg*/url()}




/* checkbox */
.rass-section-input input[type="checkbox"]+label {
	display : inline-block;
}

.rass-ui-checkbox {
	width         : 100%;
	margin-bottom : 1em;
}

.rass-ui-checkbox label {
	width         : auto;
	margin-bottom : 0;
	font-size: 1rem;
}

/* icon link */
.rass-container .rass-icon-link {
	position      : relative;
	display       : inline-block;

	height        : auto;
	margin-bottom : 0.5em;
	padding       : 0.3em 0 0.2em 2em;

	line-height   : 120%;
}

.rass-container a.rass-icon-link {
	margin-left : 4px;
	font-size   : 1.2rem;
}

