.rass-container a.rass-external-link {
	background : url(images/icon_external_26px.png) center left no-repeat;
}

.rass-container a.rass-help-link {
	background : url(images/icon-help-26px.png) center left no-repeat;
}

.rass-container a.rass-legal-link {
	background : url(images/icon-juridisch-26px.png) center left no-repeat;
}

.rass-container a.rass-reader-link {
	background : url(images/scanner-icon-26px.png) center left no-repeat;
}
*/

.rass-container a.rass-default-link {
	display       : inline-block;

	height        : 26px;
	margin-bottom : 0.5em;
	margin-left   : 4px;
	padding-left  : 35px;

	background    :  center left no-repeat;
	line-height   : 26px;
}

.rass-container a.rass-plain-link {
	display       : inline-block;

	margin-bottom : 1em;
	margin-left: 0;
	padding-left: 4px;

}

.rass-container a.rass-plain-link-inline {
	display       : inline-block;
	margin-left: 0;
	padding-left: 0px;
}

.rass-container input.rass-plain-link {
	display       : inline-block;

	background:none;
	color: #009;
	border:none;

	padding-left: 4px;
	margin-bottom : 2em;

}


.rass-container .rass-ui-phonenumber {
	font-size : 1.2rem;
}

/* error message */
.rass-ui-error, .rass-ui-servererror {
	display            : block;
	clear              : both;
	box-sizing         : border-box;

	min-height         : 1.9em;
	width              : 100%;
	margin-top         : 0.4em;
	padding-left       : 16px;

	font-size          : 0.9rem;
	font-style         : normal;
	font-weight        : normal;
	color              : red;

	-webkit-box-sizing : border-box;
	-moz-box-sizing    : border-box;
}

.rass-container .rass-ui-servererror {
	
	min-height:0;

}

.rass-section-error {
	padding : 8px 0 30px 0;
	color   : red;
}

.rass-state-svrerror {
	margin-bottom : 1em;
	margin-left   : 4px;

	color         : red;
}

/* specific extensions */
.rass-section-input .rass-extend-rr {
	min-height    : 130px;
	padding-right : 70px;
	padding-left  : 0;

	background    :  top right no-repeat;
}

.rass-section-input .rass-extend-rr p {
	height : 110px;
}

/* formgroup section (visual vertical formatting) */
.rass-section-input .rass-section-formgroup {
	margin-bottom : 1.5em;
	padding-top   : 1.5em;
}

/* signeren stappenplan */
.rass-ui-signsteps {
	margin-left : -9px;
	margin-bottom:0.5em;
	width: 100%;
}

#rass-uicontrol-qrcode, #scanner-code {
	width: 250px;
	height:250px;
	margin-left: -16px;
}

/* VC code switching */

.rass-state-hasvc .rass-uicontrol-qrcode {
	display:none;
}

#rass-uicontrol-qrcode, .rass-state-hasvc #scanner-code {
	display:block;
}

/* opdracht summary */
.rass-container .rass-section-summary {
	margin-bottom : 12px;
	margin-left   : 4px;
	padding       : 16px 0;

	border-top    : 1px solid #CCC;
	border-bottom : 1px solid #CCC;
}

.rass-container .rass-extend-openbox {
	border-bottom : none;
}

/* phone list */
.rass-container .rass-section-input .rass-section-list input {
	display     : inline;

	height      : 1em;
	width       : 10%;
	margin      : 0;
	margin-left : 1em;
}

.rass-container .rass-section-input  .rass-section-list span {
	display     : inline-block;

	height      : 1.8em;

	font-size   : 1.2rem;
	line-height : 1.5em;

	padding-left: 0;
}

.rass-container  .rass-section-input .rass-section-list label {
	width         : 100%;
	border-bottom : 1px solid #CCC;
	padding: 0.5em 0 0.5em 0;
}

.rass-container  .rass-section-input .rass-section-list label:last-child {
	border : none;
}

/* notificatie */
.rass-container .rass-ui-notification {
	margin-bottom : 16px;
	margin-left   : 4px;
}



/* centered profile section */

.rass-container .rass-section-profile .rass-ui-profielnaam {
    margin: auto auto;
    width: 70%;
    /*
    text-align: center;
    */
    padding-bottom: 0;
    margin-bottom: 2em;
}


.rass-container .rass-section-input .rass-ui-profielnaam input {
	border-bottom-left-radius: 0;
	background: 14px 0 no-repeat;
	padding-left: 36px;
	background-size: contain;
}	

.rass-container .rass-section-profile label {
                width:100%;
                text-align: left;
                font-size:0.9rem;
            }

.rass-container .rass-section-profile img {
  	border-radius: 100%;
  	border: 3px solid #CCC;
	position: relative;
}

.rass-container .rass-section-profile .rass-container-profileimg{
	width:120px;
	margin:auto auto;
	position: relative;
}

.rass-container .rass-section-profile .rass-container-profileimg:before {
	content:'';
	display: block;
	background:;
	width:32px;
	height:32px;
	position: absolute;
	bottom: 20px;
	right:20px;
	z-index:99;
}

.rass-container .rass-section-profile  p, a {
                padding-left: 0;
            }


 .rass-container .rass-section-formgroup {
                margin-bottom:0;
                position: relative;
            }

 .rass-container .rass-section-profile  .rass-ui-profielnaam  label span {
                display: none;
            }    

.rass-container .rass-page-title .rass-section-profile {
                text-align: center;
                display: block;
                padding-bottom: 0;
            }




/*** RASS States ***/

.rass-container .rass-state-disabled,
.rass-container .rass-state-disabled .wrap,
.rass-container .rass-state-disabled.rass-state-active .wrap,
.rass-container .rass-section-input .rass-state-disabled label,
.rass-container .rass-section-input .rass-state-disabled input,

.rass-container .rass-section-input label.rass-state-disabled input,
.rass-container .rass-section-input .rass-state-disabled.rass-state-active input,
.rass-container .rass-section-input label.rass-state-disabled input:focus {
	color:#D8D8D8;
	border-bottom-color:#D8D8D8;
	border-width: 1px;
}


.rass-section-input .rass-state-disabled label {
	border-color:#D8D8D8;
}



/*** swaplist states ***/
.rass-page-dposign .rass-section-input ul {
	list-style: none;
}


.rass-page-dposign .rass-section-input ul li {
	text-indent:0;
	position: relative;
}

.rass-page-dposign .rass-section-input ul li::before {
	content:'\2022';
	position: absolute;
	top: 0;
	left: -1em;
	width: 1em;
	height: 1em;
	font-size: 1em;
}

.rass-page-dposign .rass-section-input ul li:last-child {
	position: static;
}

.rass-page-dposign .rass-section-input ul li:last-child::before {
	display: none;
}

ul.rass-ui-swaplist li:first-child {
	display:block;
	cursor:pointer;
	padding-right: 1.2em;
	margin-left: -6px;
}

ul.rass-ui-swaplist li:last-child {
	display:block;
	margin-left: 0;
}

ul.rass-ui-swaplist li:first-child::before, ul.rass-ui-swaplist li:last-child::before {
	display: none;
}

/* closed */
.rass-state-swapclosed li {
	display:none;
	position: relative;
}

.rass-state-swapclosed li:first-child::after {
	content:'+';
	position: absolute;
	color:#009;
	top: -1px;
	right: 0;
	width: 0.6em;
	height: 1em;
	font-size: 2rem;
}

.rass-state-swapclosed li:first-child:hover::after {
	color:#F60;
}	

/* opened */
.rass-state-swapopened li {
	display:block;
	position: relative;
}


.rass-state-swapopened li:first-child {
	margin-bottom: 1em;
}

.rass-state-swapopened li:last-child {
	margin-top: 1em;
}

.rass-state-swapopened li:first-child::after {
	content:'\2013';
	position: absolute;
	color:#009;
	top: -2px;
	right: 0;
	width: 0.6em;
	height: 1em;
	font-size: 2rem;
}

.rass-state-swapopened li:first-child:hover::after {
	color:#F60;
}	

/*** adaptive states ***/

/* hide summary on desktop & tablet */

.rass-section-signsummary {
	display: none;
}	


/*** fix for disabling submit button selection on ios/cordova webview (RASS-1017) ***/

    .rass-section-action, .rass-section-action input[type="submit"] {

        
        -webkit-user-select:none !important;
        -webkit-touch-callout: none !important;
        -webkit-user-modify:none !important;

    }


/*** WAI ARIA Helper classes ***/

.rass-container .rass-aria-label {
	height:100%;
}

.rass-container .rass-aria-hidden {
	opacity: 0 !important;
	height:0 !important;
	text-indent: -9999px !important;
}

#rass-section-softkey label {
    position: absolute;
    left: -99999px;
}


.rass-skiplink{ 
	position:absolute; 
	left:-10000px; 
	top:auto; 
	width:1px; 
	height:1px; 
	overflow:hidden;
